import React from "react";
import CategoryCard from "../components/CategoryCard";
import "./Categories.css";

function Categories() {
  const categoryList = [
    { image: "/images/bento.jpg", title: "Bento Cakes" },
    { image: "/images/cupcakes.jpg", title: "Cupcakes" },
    { image: "/images/pancakes.jpg", title: "Pancakes" },
    { image: "/images/waffles.jpg", title: "Waffles" },
    { image: "/images/customcake.jpg", title: "Custom Cakes" },
    { image: "/images/cookies.jpg", title: "Cookies" },
  ];

  return (
    <div className="category-section">
      <h2 className="category-heading">Shop by Categories</h2>

      <div className="category-grid">
        {categoryList.map((cat, i) => (
          <CategoryCard key={i} image={cat.image} title={cat.title} />
        ))}
      </div>
    </div>
  );
}

export default Categories;
